    'help.PersonalTouch': {value: 'Pros\xEDm, zadejte sv\xE9 jm\xE9no. P\u0159id\xE1n\xEDm osobn\xEDho stylu p\u0159il\xE1k\xE1te v\xEDce odpov\u011Bd\xED.', index: 4794},
    'help.PlsRemeberRules': {value: 'Pamatujte pros\xEDm na na\u0161e pravidla\u2026', index: 4795},
    'help.PostingBalloonTip_description_30_301': {value: 'Zadejte podrobnosti o va\u0161\xED nemovitosti jako nap\u0159. klimatizace, komory, p\u0159edn\xED \u010Di zadn\xED \u010D\xE1st, pro rodinu, na penzi.', index: 4796},
