    'help.PostingBalloonTip_description_99_367': {value: 'Ud\u011Blejte z va\u0161\xED nemovitosti HORK\xC9 ZBO\u017D\xCD, vytvo\u0159te podrobn\xFD popis o alespo\u0148 150 slovech uv\xE1d\u011Bj\xEDc\xED jedine\u010Dnou obchodn\xED nab\xEDdku ve vztahu k va\u0161emu bytu/pozemku, nap\u0159. celkovou v\xFDm\u011Bru, po\u010Det m\xEDstnost\xED, koupelen, galeri\xED, za\u0159\xEDzen\xFD/\u010D\xE1ste\u010Dn\u011B za\u0159\xEDzen\xFD, nov\xFD/star\xFD, bl\xEDzkost n\xE1kupn\xEDho centra/parku/\u0161koly/nemocnice/autobusov\xE9 zast\xE1vky/stanice metra atd. P\u0159idejte k va\u0161emu inzer\xE1tu fotografie, aby na n\u011Bj odpov\u011Bd\u011Blo v\xEDce lid\xED.', index: 4809},
    'help.PostingBalloonTip_description_99_378': {value: 'Vytvo\u0159te k va\u0161emu vozu neodolateln\xFD popis a uve\u010Fte specifikace, nad nimi\u017E kupci u\u017Easnou. Pou\u017Eijte n\u011Bkolik obr\xE1zk\u016F a popis o alespo\u0148 150 slovech a sd\u011Blte kupc\u016Fm, jak velkou cenu pro v\xE1s v\xE1\u0161 milovan\xFD v\u016Fz m\xE1.', index: 4810},
