    'help.PostingBalloonTip_photo_30': {value: 'M\u016F\u017Eete vlo\u017Eit a\u017E 20 fotografi\xED. Zkontrolujte, zda jsou z\u0159eteln\xE9 a kvalitn\xED. Nedovolujeme vkl\xE1d\xE1n\xED fotografi\xED, kter\xE9 obsahuj\xED odkazy (URL) nebo e-mailov\xE9 adresy.', index: 4813},
