    'terms.LimitationsLiability_content': {value: 'IN NO EVENT SHALL OLX, ITS OFFICERS, DIRECTORS, EMPLOYEES, OR AGENTS, BE LIABLE FOR DIRECT, INDIRECT, INCIDENTAL, SPECIAL, CONSEQUENTIAL OR EXEMPLARY DAMAGES (EVEN IF OLX HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES), RESULTING FROM ANY ASPECT OF YOUR USE OF THE OLX SITE OR THE SERVICE, WHETHER THE DAMAGES ARISE FROM USE OR MISUSE OF THE OLX SITE OR THE SERVICE, FROM INABILITY TO USE THE OLX SITE OR THE SERVICE, OR THE INTERRUPTION, SUSPENSION, MODIFICATION, ALTERATION, OR TERMINATION OF THE OLX SITE OR THE SERVICE.  SUCH LIMITATION SHALL ALSO APPLY WITH RESPECT TO DAMAGES INCURRED BY REASON OF OTHER SERVICES OR PRODUCTS RECEIVED THROUGH OR ADVERTISED IN CONNECTION WITH THE OLX SITE OR THE SERVICE OR ANY LINKS ON THE OLX SITE, AS WELL AS BY REASON OF ANY INFORMATION OR ADVICE RECEIVED THROUGH OR ADVERTISED IN CONNECTION WITH THE OLX SITE OR THE SERVICE OR ANY LINKS ON THE OLX SITE.  THESE LIMITATIONS SHALL APPLY TO THE FULLEST EXTENT PERMITTED BY LAW. <br /> YOU SPECIFICALLY ACKNOWLEDGE THAT OLX SHALL NOT BE LIABLE FOR USER SUBMISSIONS OR THE DEFAMATORY, OFFENSIVE, OR ILLEGAL CONDUCT OF ANY THIRD PARTY AND THAT THE RISK OF HARM OR DAMAGE FROM THE FOREGOING RESTS ENTIRELY WITH YOU. <br /> The OLX website is controlled and offered by OLX from its facilities in the United States of America.  OLX makes no representations that the OLX Website is appropriate or available for use in other locations.  Those who access or use the OLX Website from other jurisdictions do so at their own volition and are responsible for compliance with local law.', index: 4902},
    'terms.LimitationsLiability_title': {value: 'LIMITATIONS OF LIABILITY', index: 4903},
    'terms.LimitationTerminationService_content': {value: 'You acknowledge that OLX may establish limits concerning use of the Service, including among others, the maximum number of days that Content will be retained by the Service, the maximum number and size of postings, email messages, or other Content that may be transmitted or stored by the Service, and the frequency with which you may access the Service.  You agree that OLX has no responsibility or liability for the deletion or failure to store any Content maintained or transmitted by the Service. You acknowledge that OLX reserves the right at any time to modify or discontinue the Service (or any part thereof) with or without notice, and that OLX shall not be liable to you or to any third party for any modification, suspension or discontinuance of the Service.<br />You agree that OLX, in its sole discretion, has the right (but not the obligation) to delete or deactivate your account, block your email or IP address, or otherwise terminate your access to or use of the Service (or any part thereof), immediately and without notice, and remove and discard any Content within the Service, for any reason, including, without limitation, if OLX believes that you have acted inconsistently with the letter or spirit of the Terms.  Further, you agree that OLX shall not be liable to you or any third-party for any termination of your access to the Service.  Further, you agree not to attempt to use the Service after said termination.', index: 4904},
