    'about.HistoryText1': {value: 'Spole\u010Dnost OLX byla zalo\u017Eena v roce 2006 v Argentin\u011B, a to podnikateli zam\u011B\u0159en\xFDmi na podnik\xE1n\xED na internetu, Fabricem Grindou a Alecem Oxenfordem. Dnes je jednou z p\u0159edn\xEDch bezplatn\xFDch platforem s inzer\xE1ty na sv\u011Bt\u011B, kter\xE1 je dostupn\xE1 ve v\xEDce ne\u017E 40 zem\xEDch a 50 jazyc\xEDch.', index: 4955},
    'about.HistoryText2': {value: 'Ka\u017Ed\xFD den miliony lid\xED na cel\xE9m sv\u011Bt\u011B OLX pou\u017E\xEDvaj\xED k n\xE1kupu nebo prodeji zbo\u017E\xED a automobil\u016F, p\u0159i hled\xE1n\xED zam\u011Bstn\xE1n\xED nebo p\u0159i pron\xE1jmu domu. Platforma OLX ka\u017Ed\xFD m\u011Bs\xEDc nav\u0161t\xEDv\xED p\u0159es 200 milion\u016F jedine\u010Dn\xFDch u\u017Eivatel\u016F a p\u0159es 11 miliard zobrazen\xED str\xE1nky za m\u011Bs\xEDc, jin\xFDmi slovy 360 milion\u016F zobrazen\xED str\xE1nky ka\u017Ed\xFD den. Skupina m\xE1 1200 zam\u011Bstnanc\u016F v kancel\xE1\u0159\xEDch v Buenos Aires, Kapsk\xE9m M\u011Bst\u011B, Dill\xED, Sao Paulu, Rio de Janeiru, Lisabonu a New Yorku.', index: 4956},
    'about.HistoryText3': {value: 'Spole\u010Dnost Naspers v srpnu 2010 nabyla p\u016Fvodn\xED pod\xEDl 67,8 % v OLX.inc, kter\xFD n\xE1sledn\u011B nav\xFD\u0161ila a\u017E na 95 %. V r\xE1mci iniciativy na transformaci OLX na nejv\u011Bt\u0161\xED platformu pro prodej p\u0159\xEDmo mezi z\xE1kazn\xEDky (C2C) na sv\u011Bt\u011B spole\u010Dnost Naspers ned\xE1vno konsolidovala sv\xE9 slu\u017Eby on-line inzerce na Filip\xEDn\xE1ch, v Thajsku, Polsku, Ma\u010Farsku, Bulharsku, Rumunsku a Indon\xE9sii a sjednotila je pod zna\u010Dku OLX.', index: 4957},
