    'about.PostingBalloonTip_Email_0_0': {value: 'Uve\u010Fte va\u0161e skute\u010Dn\xE9 jm\xE9no, aby kupci v\u011Bd\u011Bli, jak v\xE1s maj\xED p\u0159i kontaktov\xE1n\xED oslovit. Nemus\xEDte uv\xE1d\u011Bt cel\xE9 jm\xE9no.', index: 4980},
