    'about.SellingIsEasy': {value: 'Prodej je snadn\xFD', index: 4982},
    'about.SellThings': {value: 'Prodejte v\xE1\u0161 pou\u017Eit\xFD telefon, kter\xFD se povaluje v \u0161upl\xEDku.</br>Prodejte kytaru, na kterou jste nikdy po\u0159\xE1dn\u011B nehr\xE1li.</br>Prodejte d\u011Btsk\xFD ko\u010D\xE1rek va\u0161\xED sestry, kter\xFD je schovan\xFD u n\xED ve sk\u0159\xEDni.</br>Prodejte v\xE1\u0161 motocykl a po\u0159i\u010Fte si nov\u011Bj\u0161\xED.</br>Prodejte boty, kter\xE9 u\u017E v\xE1m nepadnou.</br>Prodejte v\xE1\u0161 automobil.</br>', index: 4983},
