    'about.WeekendTakesLonger': {value: 'Aktivace inzer\xE1t\u016F zadan\xFDch b\u011Bhem noci nebo v\xEDkendu m\u016F\u017Ee trvat d\xE9le. Nezad\xE1vejte inzer\xE1t podruh\xE9.', index: 4989},
    'about.WithinTime': {value: '<li>V \u0159\xE1du vte\u0159in m\u016F\u017Eete v\xE1\u0161 p\u0159edm\u011Bt nab\xEDdnout k prodeji (pou\u017Eijte v\xE1\u0161 telefon!)</li><li>V \u0159\xE1du minut se v\xE1\u0161 inzer\xE1t objev\xED na OLX</li><li>V \u0159\xE1du hodin se v\xE1m mohou ozvat z\xE1jemci o koupi</li><li>V \u0159\xE1du dn\u016F se m\u016F\u017Eete setkat s kupci a prodat p\u0159edm\u011Bt za hotov\xE9</li><li>V \u0159\xE1du t\xFDdn\u016F budete m\xEDt jednodu\u0161\u0161\xED a lep\u0161\xED \u017Eivot</li>', index: 4990},
    'mail_crm.AntiFraudInfo': {value: 'Pro dal\u0161\xED informace nav\u0161tivte na\u0161e <a href="<<ForumLink>>">f\xF3rum proti podvod\u016Fm zde</a>, nebo chcete-li si p\u0159e\u010D\xEDst dal\u0161\xED bezpe\u010Dnostn\xED tipy, <a href="<<Help26Link>>">klepn\u011Bte sem</a>.', index: 4991},
