    'mail_crm.CRM_FirstPost_031_AnonymousUser': {value: '<p style="color:#f00;"><strong>U\u017DITE\u010CN\xDD TIP:</strong></p><p>Abyste mohli web OLX pou\u017E\xEDvat, nemus\xEDte se registrovat, ale doporu\u010Dujeme v\xE1m to:<br /><ul><li>Spr\xE1va va\u0161ich z\xE1znam\u016F je pak snaz\u0161\xED.</li><li>Registrace je rychl\xE1 a bezplatn\xE1.</li></ul><a href="<<RegisterLink>>">Registrujte se nyn\xED!</a></p>', index: 5003},
