    'misc.PostingBalloonTip_ContactName_0_0': {value: '<B> Uve\u010Fte va\u0161e skute\u010Dn\xE9 jm\xE9no, aby kupci v\u011Bd\u011Bli, jak v\xE1s maj\xED p\u0159i kontaktov\xE1n\xED oslovit.  </B><UL><LI> Nemus\xEDte uv\xE1d\u011Bt cel\xE9 jm\xE9no.</LI></UL>', index: 10433},
    'misc.PostingBalloonTip_Description_0_0': {value: '<B> Uve\u010Fte v popisu podrobnosti a prodejte rychleji! </B><UL><LI> Popi\u0161te v\u0161echny mo\u017En\xE9 charakteristiky nab\xEDzen\xE9ho v\xFDrobku nebo slu\u017Eby.</LI><LI> Rovn\u011B\u017E p\u0159idejte informace o tom, jak si p\u0159ejete b\xFDt kontaktov\xE1ni (telefon a/nebo e-mail) a jak\xFDm zp\u016Fsobem se chcete na obchodu dohodnout.</LI></UL>', index: 10434},
    'misc.PostingBalloonTip_description_0_301': {value: 'Uve\u010Fte podrobnosti o va\u0161\xED nemovitosti jako nap\u0159. klimatizace, sk\u0159\xEDn\u011B, p\u0159edn\xED nebo zadn\xED vchod, vhodn\xE9 pro rodinu nebo na penzi.', index: 10435},
    'misc.PostingBalloonTip_description_0_363': {value: '<B> Uve\u010Fte v popisu podrobnosti a pronajm\u011Bte nemovitost rychleji!</B> <UL><LI> Uve\u010Fte charakteristiky jako nap\u0159. stav nemovitosti, rozlohu pozemku, po\u010Det m\xEDstnost\xED v jednotliv\xFDch podla\u017E\xEDch, po\u010Det podla\u017E\xED atd. </LI><LI> Nezapome\u0148te uv\xE9st podrobnosti jako nap\u0159. doba pou\u017E\xEDv\xE1n\xED a stav.</LI></UL>', index: 10436},
    'misc.PostingBalloonTip_description_0_367': {value: '<B> Uve\u010Fte v popisu podrobnosti a prodejte nemovitost rychleji!</B> <UL><LI> Uve\u010Fte charakteristiky jako nap\u0159. stav nemovitosti, rozlohu pozemku, po\u010Det m\xEDstnost\xED v jednotliv\xFDch podla\u017E\xEDch, po\u010Det podla\u017E\xED atd. </LI><LI> Nezapome\u0148te uv\xE9st podrobnosti jako nap\u0159. doba pou\u017E\xEDv\xE1n\xED a stav.</LI></UL>', index: 10437},
    'misc.PostingBalloonTip_description_0_368': {value: '<B> Uve\u010Fte v popisu podrobnosti a prodejte/pronajm\u011Bte nemovitost rychleji!</B> <UL><LI> Uve\u010Fte charakteristiky jako nap\u0159. stav nemovitosti, m\xEDsto a zaj\xEDmav\xE1 m\xEDsta v okol\xED atd. </LI><LI> Uve\u010Fte v\u0161echny podrobnosti o vybaven\xED, jako nap\u0159. klimatizace, po\u010Det toalet, osv\u011Btlen\xED atd. </LI><LI> Nezapome\u0148te uv\xE9st podrobnosti jako nap\u0159. doba pou\u017E\xEDv\xE1n\xED a stav.</LI></UL>', index: 10438},
    'misc.PostingBalloonTip_description_0_376': {value: 'Uve\u010Fte informace jako nap\u0159\xEDklad obratnost, motor, dokumentace, palivo.', index: 10439},
    'misc.PostingBalloonTip_description_0_377': {value: '<B> Uve\u010Fte v popisu podrobnosti a prodejte rychleji! </B><UL><LI>Uve\u010Fte informace jako nap\u0159. zachovalost, technick\xE9 charakteristiky a p\u016Fvod.</LI></UL>', index: 10440},
    'misc.PostingBalloonTip_description_0_378': {value: '<B> Uve\u010Fte v popisu podrobnosti a prodejte rychleji!! </B> <UL><LI> Popi\u0161te charakteristiky vozidla, jako nap\u0159. klimatizace, typ \u0159azen\xED, centr\xE1ln\xED zamyk\xE1n\xED a ovl\xE1d\xE1n\xED oken, alarm, airbag, stereo.</LI><LI> Nezapome\u0148te uv\xE9st podrobnosti jako nap\u0159. doba pou\u017E\xEDv\xE1n\xED, zachovalost a d\u016Fvod prodeje.</LI></UL>', index: 10441},
    'misc.PostingBalloonTip_description_0_379': {value: '<B> Uve\u010Fte v popisu podrobnosti a prodejte rychleji! </B><UL><LI> Popi\u0161te charakteristiky motocyklu, uve\u010Fte: zna\u010Dku, model, verzi, barvu, typ \u0159azen\xED a paliva. </LI><LI> Rovn\u011B\u017E uve\u010Fte voliteln\xE9 polo\u017Eky jako nap\u0159.: alarm, ABS, n\xE1razn\xEDk atd. </LI><LI> Nezapome\u0148te uv\xE9st podrobnosti jako doba pou\u017E\xEDv\xE1n\xED, zachovalost a d\u016Fvod prodeje.</LI></UL>', index: 10442},
    'misc.PostingBalloonTip_description_0_388': {value: '<B> Napi\u0161te p\u0159ita\u017Eliv\xFD popis a pronajm\u011Bte nemovitost rychleji! </B> <UL><LI> Uve\u010Fte podrobnosti o nemovitosti, jako nap\u0159. dobu trv\xE1n\xED pron\xE1jmu, po\u010Det lo\u017Enic a koupelen, kapacitu, prostor pro rekreaci, parkovac\xED m\xEDsta atd. </LI><LI> Nezapome\u0148te uv\xE9st podrobnosti jako je doba u\u017E\xEDv\xE1n\xED, stav a d\u016Fvod pron\xE1jmu.</LI> </UL>', index: 10443},
    'misc.PostingBalloonTip_description_0_410': {value: '<B> Uve\u010Fte v popisu podrobnosti a prodejte/pronajm\u011Bte nemovitost rychleji! </B><UL><LI> Uve\u010Fte charakteristiky jako nap\u0159. rozlohu, lokalitu, orientaci, topografii, v\xFDznamn\xE1 m\xEDsta a zaj\xEDmavosti v okol\xED. </LI><LI> Nezapome\u0148te na podrobnosti jako nap\u0159. stav a d\u016Fvod prodeje/pron\xE1jmu.</LI></UL>', index: 10444},
    'misc.PostingBalloonTip_description_0_415': {value: 'Uve\u010Fte podrobnosti jako nap\u0159. m\xEDsto, oblast, topografii, pam\xE1tky a zaj\xEDmavosti v okol\xED.', index: 10445},
