    'misc.PostingBalloonTip_Description_0_822': {value: '<B>Uve\u010Fte v popisu podrobnosti a oslovte tak vhodn\xE9 kandid\xE1ty! </B><UL><LI> Uve\u010Fte podrobnosti o pozici, po\u017Eadavc\xEDch a povinnostech</LI><LI> Nezapome\u0148te uv\xE9st informace o m\xEDst\u011B v\xFDkonu a benefitech</LI></UL>', index: 10457},
