    'misc.TipsForBuyers': {value: 'Tipy pro kupce:', index: 10773},
    'misc.TipsForBuyersList': {value: '<li>Nakupujte ve sv\xE9m okol\xED, abyste mohli p\u0159edm\u011Bt zkontrolovat, setkat se s prodejcem a zaplatit v okam\u017Eiku vyzvednut\xED nebo dod\xE1n\xED. Nezapome\u0148te k setk\xE1n\xED vyu\u017E\xEDt bezpe\u010Dn\xE9 m\xEDsto. </li><li>Nejlep\u0161\xEDm zp\u016Fsobem, jak obchod uskute\u010Dnit, je prov\xE9st v\xFDm\u011Bnu polo\u017Eky a platbu z\xE1rove\u0148. </li><li>Po\u017E\xE1dejte o srozumiteln\xE9 informace o stavu zbo\u017E\xED, cen\u011B, platb\u011B a zp\u016Fsobu dod\xE1n\xED.</li><li>Pou\u017E\xEDvejte pouze platebn\xED metody, kter\xFDm d\u016Fv\u011B\u0159ujete a kter\xE9 dob\u0159e zn\xE1te.</li><li>Pokud je v\xFDrobek zas\xEDl\xE1n z\xE1silkou, po\u017E\xE1dejte prodejce o \u010D\xEDslo z\xE1silky za \xFA\u010Delem jej\xEDho sledov\xE1n\xED. </li><li>Z\xEDskejte od prodejce ov\u011B\u0159iteln\xE9 telefonn\xED \u010D\xEDslo.</li><li>V p\u0159\xEDpad\u011B elektroniky, automobil\u016F a motocykl\u016F byste p\u0159ed jejich zakoupen\xEDm m\u011Bli vyzkou\u0161et jejich funk\u010Dnost.</li><li>Ud\u011Blejte si pr\u016Fzkum a zjist\u011Bte si konkuren\u010Dn\xED ceny v\xFDrobku.</li><li>Nesd\xEDlejte sv\xE9 finan\u010Dn\xED informace. </li><li>Pro kontaktov\xE1n\xED prodejce v\u017Edy pou\u017Eijte funkci "Napsat prodejci e-mail". Pokud zjist\xEDme jakoukoli podvodnou \u010Dinnost ze strany prodejce, m\u016F\u017Eeme v\xE1m tak d\xE1t okam\u017Eit\u011B v\u011Bd\u011Bt.</li>', index: 10774},
    'misc.TipsForSellers': {value: 'Tipy pro prodejce:', index: 10775},
    'misc.TipsForSellersList': {value: '<li>Nejlep\u0161\xED mo\u017Enost\xED je uhradit plnou cenu v okam\u017Eiku dod\xE1n\xED. Nezapome\u0148te se setkat na bezpe\u010Dn\xE9m m\xEDst\u011B.</li><li>V p\u0159\xEDpad\u011B \u017E\xE1dosti o hromadnou objedn\xE1vku si ov\u011B\u0159te doklady kupuj\xEDc\xEDho.</li><li>Z\xEDskejte od kupuj\xEDc\xEDho ov\u011B\u0159iteln\xE9 telefonn\xED \u010D\xEDslo.</li><li>Ujist\u011Bte se, \u017Ee v\xE1\u0161 v\xFDrobek odpov\xEDd\xE1 charakteristice uveden\xE9 v inzer\xE1tu, abyste p\u0159ede\u0161li nedorozum\u011Bn\xED s kupuj\xEDc\xEDm.</li><li>Nesd\xEDlejte jin\xE9 finan\u010Dn\xED informace ne\u017E ty, kter\xE9 jsou zapot\u0159eb\xED k proveden\xED platby.</li>', index: 10776},
