    'mail_crm2.DoNotPurchaseAnimalsFromOutsideYourCountry': {value: '<li><strong>Nekupujte zv\xED\u0159ata ze zahrani\u010D\xED</strong>. \u0158i\u010Fte se pros\xEDm platn\xFDmi z\xE1kony. M\u011Bjte zejm\xE9na na pam\u011Bti, \u017Ee obchodov\xE1n\xED s n\u011Bkter\xFDmi \u201Eexotick\xFDmi\u201C zv\xED\u0159aty nebo jejich prodej jsou zak\xE1z\xE1ny.</li>', index: 11428},
