    'mail_crm2.NeverPayTheSellerForDeliveringAnAnimalToYou': {value: '<li><strong>NIKDY</strong> nepla\u0165te prod\xE1vaj\xEDc\xEDmu za dod\xE1n\xED zv\xED\u0159ete. Nab\xEDzen\xE9 zv\xED\u0159e pravd\u011Bpodobn\u011B neexistuje. Jedn\xE1 se o fale\u0161nou z\xE1minku, jak z v\xE1s vyl\xE1kat pen\xEDze.</li>', index: 11430},
    'mail_crm2.NeverPayThroughWesternUnionEspeciallySomeoneWhoIsAbroad': {value: '<li><strong>NIKDY neprov\xE1d\u011Bjte platbu prost\u0159ednictv\xEDm Western Union</strong>, zejm\xE9na p\u0159\xEDjemci, kter\xFD je v zahrani\u010D\xED.</li>', index: 11431},
    'mail_crm2.ThereAreNoGiftsOfValuableAnimals': {value: '<li><strong>CENN\xC1 ZV\xCD\u0158ATA SE JAKO DAR NED\xC1VAJ\xCD.</strong> Pravd\u011Bpodobn\u011B se jedn\xE1 o podvod, zejm\xE9na pokud se toto (smy\u0161len\xE9) zv\xED\u0159e nach\xE1z\xED v zahrani\u010D\xED a vy m\xE1te zaplatit \u201EPOUZE\u201C po\u0161tovn\xE9. </li>', index: 11432},
    'mail_crm2.WeRecommendYouMeetTheSellerToSeeExistenceAndHealthOfAnimal': {value: 'Doporu\u010Dujeme zejm\xE9na, abyste se s prod\xE1vaj\xEDc\xEDm se\u0161li a p\u0159esv\u011Bd\u010Dili se, \u017Ee zv\xED\u0159e skute\u010Dn\u011B existuje a \u017Ee je v dobr\xE9 kondici. Jedn\xE1 se o zdaleka nejlep\u0161\xED a nejbezpe\u010Dn\u011Bj\u0161\xED zp\u016Fsob, jak prov\xE9st takovou transakci.', index: 11433},
    'mail_crm2.WeSuggestYouSaveThisEmailYouWillFindUsefulInformation': {value: '<br /><span>Doporu\u010Dujume V\xE1m tento e-mail si uschovat, proto\u017Ee obsahuje u\u017Eite\u010Dn\xE9 informace o nakupov\xE1n\xED prost\u0159ednictv\xEDm aukc\xED a textov\xE9 inzerce.</span>', index: 11434},
