    'featured_listings.AdditionalTermsForFeaturedAds': {value: 'Dal\u0161\xED podm\xEDnky pro prezentovan\xE9 inzer\xE1ty', index: 11495},
    'featured_listings.AdditionalTermsForFeaturedAds_content': {value: 'Tyto dal\u0161\xED podm\xEDnky, nav\xEDc k <<LINK_TERMS_USE>>Podm\xEDnk\xE1m pou\u017Eit\xED<</LINK_TERMS_USE>> webu, upravuj\xED pou\u017Eit\xED prezentovan\xFDch inzer\xE1t\u016F:<br /><ul><li>Jako doklad \xFAhrady za prezentovan\xFD inzer\xE1t OLX pouze vystav\xED \u201EPotvrzen\xED objedn\xE1vky\u201C, kter\xE9 uvid\xEDte na z\xE1v\u011Br procesu placen\xED, a potvrzen\xED e-mailem.</li><li>Pokud v\xE1\u0161 inzer\xE1t nen\xED z n\u011Bjak\xE9ho d\u016Fvodu, a\u0165 ji\u017E technick\xE9ho nebo jin\xE9ho r\xE1zu, zobrazen v oblasti ur\u010Den\xE9 pro prezentovan\xE9 inzer\xE1ty, zodpov\u011Bdnost OLX se omezuje pouze na jeho zve\u0159ejn\u011Bn\xED v t\xE9to oblasti v co nejkrat\u0161\xEDm mo\u017En\xE9m term\xEDnu.</li><li>Fakturaci n\xE1m zaji\u0161\u0165uje nez\xE1visl\xE1 t\u0159et\xED strana.</li><li>Na z\xE1klad\u011B v\xFDhradn\xEDho uv\xE1\u017Een\xED OLX nebudou prezentov\xE1ny inzer\xE1ty, kter\xE9 jsou ur\xE1\u017Eliv\xE9, pornografick\xE9, podvodn\xE9 (v\u010Detn\u011B duplicitn\xEDch inzer\xE1t\u016F), potenci\xE1ln\u011B podvodn\xE9 nebo kter\xE9 poru\u0161uj\xED autorsk\xE1 pr\xE1va, a platby za n\u011B nebudou vr\xE1ceny.</li><li>TATO SLU\u017DBA PREZENTOVAN\xDDCH INZER\xC1T\u016E SE POSKYTUJE \u201ETAK JAK JE\u201C NEBO \u201EPOKUD JE K DISPOZICI\u201C A NEPOSKYTUJ\xCD SE \u017D\xC1DN\xC9 Z\xC1RUKY V NEJV\u011AT\u0160\xCD MO\u017DN\xC9 M\xCD\u0158E P\u0158\xCDPUSTN\xC9 DLE Z\xC1KONA.OLX NEPOSKYTUJE \u017D\xC1DN\xC9 Z\xC1RUKY ANI PROHL\xC1\u0160EN\xCD O P\u0158ESNOSTI A \xDAPLNNOSTI OBSAHU UVEDEN\xC9HO VE SLU\u017DB\u011A PREZENTOVAN\xDDCH INZER\xC1T\u016E A Z\u0158\xCDK\xC1 SE JAK\xDDCHKOLI Z\xC1VAZK\u016E \u010CI ZODPOV\u011ADNOSTI V TOMTO OHLEDU.</li></ul>', index: 11496},
    'featured_listings.AdFeaturedHomepage_Wait': {value: 'V\xE1\u0161 inzer\xE1t je aktu\xE1ln\u011B propagov\xE1n na na\u0161\xED domovsk\xE9 str\xE1nce. V\xE1\u0161 inzer\xE1t m\u016F\u017Eete propagovat i v na\u0161ich seznamech. P\u0159edt\xEDm, ne\u017E jej budete moci znovu propagovat na na\u0161\xED domovsk\xE9 str\xE1nce po\u010Dkejte, dokud neskon\u010D\xED doba jeho propagace.', index: 11497},
