    'featured_listings.PublicationMoreThanAMonthFeaturingNotAllowed': {value: 'V\xE1\u0161 inzer\xE1t je ji\u017E v\xEDce ne\u017E m\u011Bs\xEDc online. P\u0159ed jeho zve\u0159ejn\u011Bn\xEDm na OLX je pot\u0159eba prov\xE9st aktualizaci, kter\xE1 netrv\xE1 d\xE9le ne\u017E minutu.', index: 11569},
