    'featured_listings.TermsOfService_content': {value: 'Tyto podm\xEDnky pou\u017Eit\xED se t\xFDkaj\xED prezentovan\xFDch inzer\xE1t\u016F a jsou dodatkem k na\u0161im obecn\xFDm podm\xEDnk\xE1m pou\u017Eit\xED.<br /><ul><li>OLX jako potvrzen\xED platby za prezentovan\xFD inzer\xE1t vystav\xED pouze \u201EPotvrzen\xED objedn\xE1vky\u201C, kter\xE9 uvid\xEDte na z\xE1v\u011Br procesu placen\xED, a potvrzen\xED e-mailem.</li><li>Pokud v\xE1\u0161 inzer\xE1t nen\xED z n\u011Bjak\xE9ho d\u016Fvodu, a\u0165 ji\u017E technick\xE9ho nebo jin\xE9ho r\xE1zu, zobrazen v oblasti ur\u010Den\xE9 pro prezentovan\xE9 inzer\xE1ty, na\u0161e zodpov\u011Bdnost se omezuje pouze na jeho zve\u0159ejn\u011Bn\xED v t\xE9to oblasti v co nejkrat\u0161\xEDm mo\u017En\xE9m term\xEDnu.</li><li><<CLICK_AND_BUY_LINK>><<CLICK_AND_BUY>><</CLICK_AND_BUY_LINK>> pro n\xE1s zaji\u0161\u0165uje fakturaci.</li><li>Na ve\u0161ker\xE1 data shrom\xE1\u017Ed\u011Bn\xE1 touto slu\u017Ebou se vztahuj\xED na\u0161e z\xE1sady ochrany soukrom\xED.</li><li>Nebudou zobrazeny inzer\xE1ty, kter\xE9 jsou ur\xE1\u017Eliv\xE9, pornografick\xE9, podvodn\xE9, potenci\xE1ln\u011B podvodn\xE9 nebo kter\xE9 poru\u0161uj\xED autorsk\xE1 pr\xE1va.</li><li>Nebudou zobrazeny inzer\xE1ty, kter\xE9 jsou ur\xE1\u017Eliv\xE9, pornografick\xE9, podvodn\xE9 (duplicitn\xED inzer\xE1ty), potenci\xE1ln\u011B podvodn\xE9 nebo kter\xE9 poru\u0161uj\xED autorsk\xE1 pr\xE1va a platby za n\u011B nebudou vr\xE1ceny.</li></ul>', index: 11577},
